import React, {Component} from 'react';
import styled from 'styled-components';

class Header extends Component{
    render(){
        return(
            <Container>
                <Element>
                    <Logo>
                        Khusinsa
                    </Logo>
                    <Nav>
                        <NavList>
                            <NavItem>상품 검색</NavItem>
                            <NavItem>주문 내역</NavItem>
                            <NavItem>회원 정보</NavItem>
                        </NavList>
                    </Nav>
                    <Sign>
                        <SignItem>회원가입/로그인</SignItem>
                    </Sign>
                </Element>
            </Container>
        )
    }
}


export default Header;


const Container = styled.div`
    width: 100%;
    border-bottom: 1px solid black;
`
const Element = styled.div`
    width: 100%;
    margin-left : 10px;
    margin-right : 10px;
    display: flex;
    flex-flow: row wrap;
`
const Logo = styled.span`
    order: 1;
    font-size : 20px;
    font-weight: 800;
`
const Nav = styled.span`
    order: 2;
    float: right;
    text-align:rignt;
    width: 2000px;
    height: 30px;
`
const NavList = styled.ul`
    width: 1080px;
    display: flex;
    margin: 0 auto;
`
const NavItem = styled.li`
    width: 100px;
    margin-left: 18px;
    margin-top: 5px;
    display: flex;
`
const Sign = styled.span`
    order: 3;
    width: 200px;
    display: flex;
`
const SignItem = styled.div`
    float: right;
`
